&nbsp;

Which interest should win out: your future self, who doesnt want you to get fat and unhealthy  or your present self, who doesnt care so much about that and just wants to taste something delicious?

&nbsp;

Theres no right answer. The present self usually wins, because he controls the action and so his interests are more important. But the future self actually has a stronger case: hes actually a bunch of future selves (you in 10 minutes from now, an hour from now, a day from now, three days from now, a year later, and so on). So shouldnt a thousand future selves outweigh the current selfs interest?

&nbsp;

We do this by merging the two interests. Imagine you were going to lunch with your friend, and you had to decide where to eat. You each have different preferences. Choosing one over the other  going to Japanese food (your friends preference) instead vegan Mexican (yours)  isnt fair. So maybe you pick a third choice that you both like (a place that serves sushi burritos, perhaps). Or maybe you choose this time, and your friend chooses the next time. Either way, both are happy.

